import React from 'react'

const Crews = (props) => {
  return (
    <div style={{ marginTop: "90px" }}>
        <h1>{props.name}</h1>
        <img src={props.image} className="rounded mx-auto d-block" alt="..."></img>
    </div>
  )
}

export default Crews
